import React from "react";

const Dropdown = ({ options }) => {
  const renderdOptions = options.map((option) => {
    return (
      <div key={option.value} className="label">
        {option.label}
      </div>
    );
  });

  return <h1>Dropdown</h1>;
};

export default Dropdown;
